import {
  createBrowserRouter,
  createRoutesFromElements,
  RouterProvider,
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom'




const router = createBrowserRouter(
  createRoutesFromElements(
    <Route path='/' element={<h1>Hello world</h1>} />
  )
)



function App() {
  return (
    <RouterProvider router={router}/>
  );
}

export default App;
